var init = () => {
  currency = theory.createCurrency();
  ////////////////////
  // Regular Upgrades

  // q1
  {
    let getDesc = (level) => "q_1=" + getQ1(level).toString(0);
    q1 = theory.createUpgrade(0, currency, new FirstFreeCost(new ExponentialCost(5, Math.log2(1.5))));
    q1.getDescription = (_) => Utils.getMath(getDesc(q1.level));
    q1.getInfo = (amount) => Utils.getMathTo(getDesc(q1.level), getDesc(q1.level + amount));
  }

  // q2
  {
    let getDesc = (level) => "q_2=2^{" + level + "}";
    let getInfo = (level) => "q_2=" + getQ2(level).toString(0);
    q2 = theory.createUpgrade(1, currency, new ExponentialCost(75, Math.log2(3.3)));
    q2.getDescription = (_) => Utils.getMath(getDesc(q2.level));
    q2.getInfo = (amount) => Utils.getMathTo(getInfo(q2.level), getInfo(q2.level + amount));
  }
  // q3
  {
    let getDesc = (level) => "q_3=" + getQ3(level).toString(2);
    let getInfo = (level) => "q_3=" + getQ3(level).toString(2);
    q3 = theory.createUpgrade(2, currency, new ExponentialCost(1e125, Math.log2(3165)));
    q3.getDescription = (_) => Utils.getMath(getDesc(q3.level));
    q3.getInfo = (amount) => Utils.getMathTo(getInfo(q3.level), getInfo(q3.level + amount));
    q3.bought = (_) => (updateT_flag = true);
  }

  // c1
  {
    let getDesc = (level) => "c_1=" + getC1(level).toString(0);
    let getInfo = (level) => "c_1=" + getC1(level).toString(0);
    c1 = theory.createUpgrade(3, currency, new ExponentialCost(1e4, Math.log2(1.5e7)));
    c1.getDescription = (_) => Utils.getMath(getDesc(c1.level));
    c1.getInfo = (amount) => Utils.getMathTo(getInfo(c1.level), getInfo(c1.level + amount));
    c1.maxLevel = 40;
    c1.bought = (_) => (updateT_flag = true);
  }

  // c2
  {
    let getDesc = (level) => "c_2=" + getC2(level).toString(0);
    let getInfo = (level) => "c_2=" + getC2(level).toString(0);
    c2 = theory.createUpgrade(4, currency, new ExponentialCost(1e90, Math.log2(1e6)));
    c2.getDescription = (_) => Utils.getMath(getDesc(c2.level));
    c2.getInfo = (amount) => Utils.getMathTo(getInfo(c2.level), getInfo(c2.level + amount));
    c2.bought = (_) => (updateT_flag = true);
  }
  // c3
  {
    let getDesc = (level) => "c_3=" + getC3(level).toString(0);
    let getInfo = (level) => "c_3=" + getC3(level).toString(0);
    c3 = theory.createUpgrade(5, currency, new ExponentialCost(1e65, Math.log2(700)));
    c3.getDescription = (_) => Utils.getMath(getDesc(c3.level));
    c3.getInfo = (amount) => Utils.getMathTo(getInfo(c3.level), getInfo(c3.level + amount));
    c3.bought = (_) => (updateT_flag = true);
  }
  /////////////////////
  // Permanent Upgrades
  theory.createPublicationUpgrade(0, currency, 1e11);
  theory.createBuyAllUpgrade(1, currency, 1e15);
  theory.createAutoBuyerUpgrade(2, currency, 1e20);

  ///////////////////////
  //// Milestone Upgrades
  theory.setMilestoneCost(new CustomCost((total) => BigNumber.from(getMilCustomCost(total))));

  {
    q1exp = theory.createMilestoneUpgrade(0, 3);
    q1exp.description = Localization.getUpgradeIncCustomExpDesc("q_1", "0.017");
    q1exp.info = Localization.getUpgradeIncCustomExpInfo("q_1", "0.017");
    q1exp.boughtOrRefunded = (_) => {
      updateAvailability();
      theory.invalidatePrimaryEquation();
    };
  }
  {
    diffterm = theory.createMilestoneUpgrade(1, 2);
    diffterm.getDescription = (_) => (diffterm.level < 1 ? "$\\text{Add the term q}$" : "$\\dot{q}=\\text{T_n-T_{n-1}} \\rightarrow \\dot{q}=\\max\\text{(T_n-T_{n-1})}$");
    diffterm.getInfo = (_) => (diffterm.level < 1 ? "$\\text{Adds the term q to the equation}$" : "$\\text{T_n-T_{n-1}} \\rightarrow \\dot{q}=\\max\\text{(T_n-T_{n-1})}$");
    diffterm.boughtOrRefunded = (_) => {
      updateAvailability();
      theory.invalidatePrimaryEquation();
      updateT_flag = true;
    };
    diffterm.canBeRefunded = (_) => (diffterm.level === 2 ? q3term.level === 0 : q3term.level === 0 && qexp.level === 0);
  }
  {
    q3term = theory.createMilestoneUpgrade(2, 1);
    q3term.description = Localization.getUpgradeAddTermDesc("q_3");
    q3term.info = Localization.getUpgradeAddTermInfo("q_3");
    q3term.boughtOrRefunded = (_) => {
      updateAvailability();
      updateT_flag = true;
      theory.invalidateSecondaryEquation();
      theory.invalidatePrimaryEquation();
    };
  }
  {
    cterm = theory.createMilestoneUpgrade(3, 2);
    cterm.getDescription = (_) => {
      if (cterm.level == 0) {
        return Localization.getUpgradeAddTermDesc("c_2");
      }
      return Localization.getUpgradeAddTermDesc("c_3");
    };
    cterm.getInfo = (_) => {
      if (cterm.level == 0) {
        return Localization.getUpgradeAddTermInfo("c_2");
      }
      return Localization.getUpgradeAddTermInfo("c_3");
    };
    cterm.boughtOrRefunded = (_) => {
      updateAvailability();
      updateT_flag = true;
      theory.invalidateSecondaryEquation();
    };
  }
  {
    qexp = theory.createMilestoneUpgrade(4, 3);
    qexp.description = Localization.getUpgradeIncCustomExpDesc("q", "0.0025");
    qexp.info = Localization.getUpgradeIncCustomExpInfo("q", "0.0025");
    qexp.boughtOrRefunded = (_) => {
      updateAvailability();
      theory.invalidatePrimaryEquation();
      updateT_flag = true;
    };
  }

  function getMilCustomCost(lvl) {
    switch (lvl) {
      case 0:
        return 50 * 0.1;
      case 1:
        return 100 * 0.1;
      case 2:
        return 125 * 0.1;
      case 3:
        return 150 * 0.1;
      case 4:
        return 200 * 0.1;
      case 5:
        return 325 * 0.1;
      case 6:
        return 375 * 0.1;
      case 7:
        return 400 * 0.1;
      case 8:
        return 1175 * 0.1;
      case 9:
        return 1250 * 0.1;
      default:
        return 1400 * 0.1;
    }
  }


  updateAvailability();
};

var updateAvailability = () => {
  c2.isAvailable = cterm.level > 0;
  c3.isAvailable = cterm.level > 1;
  q3.isAvailable = q3term.level > 0;
  q3term.isAvailable = diffterm.level > 1;
  qexp.isAvailable = diffterm.level > 0;
};

var tick = (elapsedTime, multiplier) => {
  let dt = BigNumber.from(elapsedTime * multiplier);
  let bonus = theory.publicationMultiplier;

  if (updateT_flag) {
    n = getC1(c1.level) + (cterm.level > 0 ? getC2(c2.level) : 0) + (cterm.level > 1 ? getC3(c3.level) : 0);
    updateT();
    updateT_flag = false;
  }

  let vq1 = getQ1(q1.level);

  q += dt * qdot;

  currency.value += dt * bonus * vq1.pow(getQ1Exp(q1exp.level)) * getQ2(q2.level) * rhoBoost * (diffterm.level > 0 ? q.pow(getQExp(qexp.level)) : 1);
  theory.invalidateTertiaryEquation();
};
var postPublish = () => {
  q = BigNumber.ONE;
  qdot = BigNumber.ZERO;
  updateT_flag = true;
  theory.invalidateTertiaryEquation();
};
var getInternalState = () => `${q} ${maxDiff} ${lastEndSearch} `;

var setInternalState = (state) => {
  let values = state.split(" ");
  if (values.length > 0) q = parseBigNumber(values[0]);
  if (values.length > 1) maxDiff = parseBigNumber(values[1]);
  if (values.length > 2) lastEndSearch = parseBigNumber(values[2]);
  updateT_flag = true;
};

var getPrimaryEquation = () => {
  theory.primaryEquationHeight = diffterm.level > 0 ? 160 : 140;
  theory.primaryEquationScale = 0.9;
  let result = "";
  result += "T_{2^k+i}\\left\\{ \\begin{array}{llll}\\frac{1}{3}(2^{2k+1}+1)  & \\text{if } i = 0,  \\\\ T_{2^k}+2T_i + T_{i+1}-1 & \\text{if } i = 1,..., 2^k - 1. \\end{array}\\right\\}\\\\\\\\\\\\ ";
  result += qexp.level === 0 ? (q1exp.level === 0 ? "\\qquad\\qquad\\qquad\\qquad\\qquad\\quad" : "\\qquad\\qquad\\qquad\\qquad\\qquad") : "\\qquad\\qquad\\qquad\\qquad\\quad";
  result += "\\dot{\\rho} = q_1";

  if (q1exp.level > 0) result += `^{${getQ1Exp(q1exp.level).toString(3)}}`;

  result += "q_2";
  if (diffterm.level > 0) result += "q";
  if (qexp.level > 0) result += `^{${getQExp(qexp.level).toString(4)}}`;
  result += "A";

  result += "\\\\\\\\ ";

  if (diffterm.level > 0) {
    if (diffterm.level === 1) result += "\\qquad\\qquad\\qquad\\qquad\\qquad\\dot{q} = " + "T_n - T_{n-1}";
    else if (diffterm.level === 2 && q3term.level === 0) result += "\\qquad\\qquad\\qquad\\qquad\\dot{q} = " + "\\max(T_n - T_{n-1})";
    else if (q3term.level > 0) result += "\\qquad\\quad\\dot{q} = " + "\\max(T_n - T_{n-1})" + "(\\min(T_n, T_{5000})^{4})^{q_3}";
  }

  return result;
};
var getSecondaryEquation = () => {
  theory.secondaryEquationHeight = 50;
  let result = "\\begin{matrix}";
  result += "A = 10^{\\lfloor log_2(n) \\rfloor}T_n";
  if (q3term.level > 0) result += "^{0.6+q_3}";
  result += `\\\\\\\\ n = c_1`;
  if (cterm.level > 0) result += " + c_2";
  if (cterm.level > 1) result += " + c_3";

  result += ",";

  result += "\\quad" + theory.latexSymbol + "=\\max\\rho^{0.1}";

  result += "\\end{matrix}";
  return result;
};
var getTertiaryEquation = () => {
  let result = "\\begin{matrix}";

  result += "n = ";
  result += n.toString(0);

  result += ",&A = ";
  result += rhoBoost.toString(0);

  if (diffterm.level > 0) {
    result += ",&q = ";
    result += q.toString();
  }
  result += "\\\\ {}\\end{matrix}";
  return result;
};
function updateT() {
  if (n < BigNumber.TWO) {
    rhoBoost = n;
    return;
  }
  let t_n = T(n);
  let t_nm1 = T(n - 1);
  maxDiff = Math.max(maxDiff, ...max.slice(lastEndSearch, n + 1));

  lastEndSearch = n - 1;

  rhoBoost = BigNumber.TEN.pow(BigNumber.from(Math.floor(Math.log2(n)))) * BigNumber.from(t_n).pow(q3term.level > 0 ? BigNumber.from(0.6) + getQ3(q3.level) : BigNumber.ONE);

  if (diffterm.level === 1) qdot = BigNumber.from(t_n - t_nm1);
  else if (diffterm.level === 2) qdot = BigNumber.from(maxDiff);
  else qdot = BigNumber.ZERO;

  qdot *= BigNumber.from(Math.min(t5000, t_n) ** 4).pow(q3term.level > 0 ? getQ3(q3.level) : BigNumber.ZERO);
}
function T(n) {
  let log2N = Math.log2(n);
  if (log2N % 1 === 0) return (2 ** (2 * log2N + 1) + 1) / 3;
  let i = n - 2 ** Math.floor(log2N);
  return T(2 ** Math.floor(log2N)) + 2 * T(i) + T(i + 1) - 1;
}

var getPublicationMultiplier = (tau) => tau.pow(1.245) / BigNumber.from(20);
var getPublicationMultiplierFormula = (symbol) => "\\frac{{" + symbol + "}^{1.245}}{20}";
var getTau = () => currency.value.pow(0.1);
var getCurrencyFromTau = (tau) => [tau.max(BigNumber.ONE).pow(10), currency.symbol];
var get2DGraphValue = () => currency.value.sign * (BigNumber.ONE + currency.value.abs()).log10().toNumber();

let getStepP1Sum = (lvl, stepLength) => (((lvl - (lvl % stepLength)) / stepLength - 1) / 2 + 1) * (lvl - (lvl % stepLength)) + (lvl % stepLength) * Math.ceil(lvl / stepLength);

var getQ1 = (level) => Utils.getStepwisePowerSum(level, 2, 10, 0);
var getQ2 = (level) => BigNumber.TWO.pow(level);
var getQ3 = (level) => level * BigNumber.from(0.01);
var getC1 = (level) => Utils.getStepwisePowerSum(level, 5, 10, 1);
var getC2 = (level) => BigNumber.from(getStepP1Sum(level, 15));
var getC3 = (level) => BigNumber.from(getStepP1Sum(level, 20));
var getQ1Exp = (level) => BigNumber.from(1 + 0.017 * level);
var getQExp = (level) => BigNumber.from(1 + 0.0025 * level);

init();
